:text: |
  Descendants of WILLIAMS, Henry and COLDHAM, Marianne
  JWILLIAMS, Edward Marsh and DAVIS, Jane
  JWILLIAMS, Arthur Frederick and THOMPSON, Leslie Elisabeth Antonia
  JWILLIAMS, Brian Leslie and HOLDERNESS, Patricia Mary
  JWILLIAMS, Elizabeth Jane and SYKES, Murray Girvan
  VSYKES, Peter Brian and BIDMEAD, Vicki Ann
  SYKES, Peter Brian and BIDMEAD, Vicki Ann (cont...)
  primary school teacher, then as a youth worker. After ordination as a Deacon in the Anglican
  Church in 1985 and served at Ponsonby, Howick, and Mangere East Parish. He is a community
  development worker, particularly with youth, education, health and housing issues. Currently he is
  employed as Director, Mangere East Family Service Centre.
  Peter is a trustee of the Henry and William Williams Memorial Trust, 'Archdeacon' for the Anglican
  Deacons of New Zealand, and Chaplain and Junior Committee Chairperson of the Mangere East Rugby
  League Football Club.
  Vicki was educated at Bayfield Primary School, Auckland Girls' Grammar School and Auckland
  University. She trained and worked as an intermediate school teacher. After study at St John's
  Theological College, Auckland, she was ordained Priest in 1987. Vicki served at Ponsonby, Howick
  and Mangere East Parish. Currently she is Director of Friendship House, an ecumenical agency
  providing hospitality and social services in Manukau City Centre. She has been involved in many
  Church groups, and currently convenes the Diocesan Sexual Harassment Monitoring Group.
  01> SYKES, Luke Wiremu
  b 27.01.1987
  Luke b. at Auckland. He attended Mangere East Primary School and is now at Southern Cross
  Campus Middle School. Amongst his many interests he is representing Auckland at athletics and
  is a member of the Mangere East Rugby League Football Club.
  02> SYKES, Joanna Mary
  b 22.07.1988
  Joanna b. at Howick, Auckland. She attends Mangere East Primary School and is actively
  involved in sports and music.
  03> SYKES, Samuel Joseph
  b 10.07.1990
  Samuel b. at Mangere East, Manukau. He attends Mangere East Primary School and is actively
  involved in sports and music.
  03> SYKES, Robert Isaac
  b 18.10.1957 d 13.05.1985
  Robert d. at Mungundi, NSW, Australia in a flying accident.
  He was an agricultural pilot.
  04> SYKES, Raylene Patricia m on 17.10.1981 to BECKER, Paul Daniel
  b 19.12.1959
  b 10.01.1957
  Raylene b. and m. at Masterton. Paul, s/o Des and Mary Becker, b, at Wellington, Address: 45
  Brittania Street, Petone.
  Raylene was educated at Makora College, Masterton, and is active in parenting programmes
  particularly Play Centre, La Leche League and Rudolph Steiner Schools. She is currently completing
  an ECE Diploma.
  Paul was educated at St Patrick's College, Wellington and is a registered electrician and a fire
  fighter.
  01> BECKER, Rachel Jane
  b 12.04.1981
  Rachel 6. at Wellington. She is a student at Raphael House Rudolf Steiner School, Belmont.
